import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";

function Slider() {
  return (
    <Carousel showThumbs={false}>
      <div>
        <img src="src={`${process.env.PUBLIC_URL}/public_assets/image1.png`}" />
      </div>
      <div>
        <img src="src={`${process.env.PUBLIC_URL}/public_assets/image2.png`}" />
      </div>
      <div>
        <img src="src={`${process.env.PUBLIC_URL}/public_assets/image3.png`}" />
      </div>
    </Carousel>
  );
}
